class Child extends React.Component{

    render(){

        return(
            <div>
                {
                    this.props.value.map((e,i) =>{
                        return(
                        <li className="c" key={i}>{e} <span onClick={this.delete}id={i}>X</span></li>
                        )
                      }
                    )
                }
            </div>
        )
    }
}


